import { Card } from "react-bootstrap";
import { Products }  from "../data/FetchProducts";

export const ProductCard = () => {
  return (
    <>
      <Card>
        <Card.Img src={Products.imgUrl} />
        <Card.Content>
          <Card.Header>Product{Products.title}</Card.Header>
          <Card.Description>{Products.description}</Card.Description>
        </Card.Content>
      </Card>
    </>
  );
};

export default ProductCard;
